import { DEFAULT_INTERVAL } from '../constants';

export default class MetricsAggregator {
  /**
   * @param {Object} [options={}] - Options to initialize MetricsAggregator.
   * @param {string} [options.prefix=''] - Prefix of metrics name.
   * @param {Array} [options.metricses=[]] - Metricses to aggregate.
   * @param {number} [options.interval=30000] - Interval to aggregate.
   * @returns {MetricsAggregator} - new MetricsAggregator Instance.
   */
  constructor(options = {}) {
    this.prefix = options.prefix || '';
    this.metricses = options.metricses || [];
    this.interval = options.interval || DEFAULT_INTERVAL;
    this.listener = '';
  }

  aggregate() {
    return this.metricses.reduce((metricses, metrics) => {
      metricses[this.prefix + metrics.getName()] = metrics.getValue();
      return metricses;
    },{});
  }

  listen(callback) {
    this.listener = setInterval(()=>{
      callback && callback(this.aggregate());
    }, this.interval);
    return this.listener;
  }

  stop() {
    return clearInterval(this.listener);
  }

  markMiddleware() {
    const requestMarker = this.metricses.find(metrics => metrics.name === 'requestCount');
    const errorMarker = this.metricses.find(metrics => metrics.name === 'errorCount');
    return (req, res, next) => {
      requestMarker && requestMarker.mark && requestMarker.mark();
      if (res.statusCode >= 400) {
        errorMarker && errorMarker.mark && errorMarker.mark();
      }
      next();
    };
  }
}

import gc from 'gc-stats';
import Metrics from '../Metrics';

export default class GarbageCollectionMetrics extends Metrics {
  constructor() {
    super();
    this.gc = (gc)();
    this.name = 'gc';
    this.value = {};
    this.listen();
  }

  listen() {
    this.gc.on('stats', stats => {
      this.value = (this.toMetrics(stats));
    });
  }

  getValue() {
    const value = { ...this.value };
    this.value = {};
    return value;
  }

  toMetrics(stats) {
    const metrics = {};
    const gcType = this.getGCType(stats.gctype);
    metrics[gcType] = stats.pauseMS;
    return metrics;
  }

  getGCType(type) {
    switch (type) {
      case 1 :
        return 'minor';
      case 2 :
      case 3 :
        return 'major';
      default :
        return '';
    }
  }
}

import memwatch from 'memwatch-next';
import heapdump from 'heapdump';
import Metrics from '../Metrics';
import warning from '../../warning';

export default class MemoryLeakMetrics extends Metrics {
  constructor(options = {}) {
    super();
    this.name = 'memoryLeak';
    this.value = {};
    this.autoDump = options.autoDump || false;
    this.listen();
  }

  listen() {
    memwatch.on('leak', stats => {
      warning(`Detected Memory Leaks ${stats}`);
      this.value = stats;
      if (this.autoDump) {
        heapdump.writeSnapshot((err, filename) => {
          if (err) {
            warning(`Heap Dump Failed ${err}`);
            return;
          }
          warning(`Heap Dump Written To ${filename}`);
        });
      }
    });
  }

  getValue() {
    const value = { ...this.value };
    this.value = {};
    return value;
  }
}

